 func (s *SmartContract) queryAllDatas(APIstub shim.ChaincodeStubInterface) sc.Response {
 
	 startKey := "DATA0"
	 endKey := "DATA9999"
 
	 resultsIterator, err := APIstub.GetStateByRange(startKey, endKey)
	 if err != nil {
		 return shim.Error(err.Error())
	 }
	 defer resultsIterator.Close()
 
	 // buffer is a JSON array containing QueryResults
	 var buffer bytes.Buffer
	 buffer.WriteString("[")
 
	 bArrayMemberAlreadyWritten := false
	 for resultsIterator.HasNext() {
		 queryResponse, err := resultsIterator.Next()
		 if err != nil {
			 return shim.Error(err.Error())
		 }
		 // Add a comma before array members, suppress it for the first array member
		 if bArrayMemberAlreadyWritten == true {
			 buffer.WriteString(",")
		 }
		 buffer.WriteString("{\"Key\":")
		 buffer.WriteString("\"")
		 buffer.WriteString(queryResponse.Key)
		 buffer.WriteString("\"")
 
		 buffer.WriteString(", \"Record\":")
		 // Record is a JSON object, so we write as-is
		 buffer.WriteString(string(queryResponse.Value))
		 buffer.WriteString("}")
		 bArrayMemberAlreadyWritten = true
	 }
	 buffer.WriteString("]")
 
	 fmt.Printf("- queryAllDatas:\n%s\n", buffer.String())
 
	 return shim.Success(buffer.Bytes())
 }

 
func (s *SmartContract) createDatas(APIstub shim.ChaincodeStubInterface, args []string) sc.Response {

	if len(args) != 13 {
		return shim.Error("Incorrect number of arguments. Expecting 13")
	}
	var args2 = []int{}
	for _, i := range args[1:13] {
		j, err := strconv.Atoi(i)
		if err != nil {
			panic(err)
		}
		args2 = append(args2, j)
	}
  	biketype1 := Biketype{Mechanical: args2[4], Ebike: 0}
	biketype2 := Biketype{Mechanical: 0, Ebike: args2[5]}
	biketype := []Biketype{biketype1,biketype2}
	data := Data{StationCode: args[1], Station_id: args2[1], Num_bikes_available: args2[2], NumBikesAvailable: args2[3], Num_bikes_available_types: biketype, Num_docks_available: args2[6], NumDocksAvailable: args2[7], Is_installed: args2[8], Is_returning: args2[9], Is_renting: args2[10], Last_reported: args2[11]}
	dataAsBytes, _ := json.Marshal(data)
	APIstub.PutState(args[0], dataAsBytes)

	return shim.Success(nil)
}

